    }
    render() {
        return (
            <div>
            <div className="jumbotron">
                <h1>Welcome Staff!!</h1>
                <button className="btn btn-info" onClick={this.display.bind(this)}>View Issues</button>
              </div>                      
            </div>
        )
    }
}

export default StaffWelcome
